import React, { Component } from "react"

import Clock from "./Clock"
import Radio from "./Radio"

const navStyle = {
  color: "red",
  backgroundcolor: "black",
}

class NavBar extends Component {
  render() {
    return (
      <div style={navStyle}>
        <nav style={navStyle}>
          <a className="navbar-brand" href="/#Clock">
            Clock
          </a>
          <a className="navbar-brand" href="/#Radio">
            Radio
          </a>
        </nav>
        <Clock/>
      </div>
    )
  }
}

export default NavBar
